import { processOnWorker } from '@loaders.gl/worker-utils';
// __VERSION__ is injected by babel-plugin-version-inline
// @ts-ignore TS2304: Cannot find name '__VERSION__'.
const VERSION = typeof "4.2.0-beta.2" !== 'undefined' ? "4.2.0-beta.2" : 'latest';
/**
 * Worker for Zlib real-time compression and decompression
 */
export const CompressionWorker = {
    id: 'compression',
    name: 'compression',
    module: 'compression',
    version: VERSION,
    options: {}
};
/**
 * Provide type safety
 */
export function compressOnWorker(data, options) {
    return processOnWorker(CompressionWorker, data, options);
}
